import React, { useState } from "react";
const DarkLight = () => {
  const [bgcolor, setBgcolor] = useState("white");
  function setDark() {
    {
      setBgcolor("black");
    }
    function setLight() {
      {
        setBgcolor("black");
      }
    }
    return (
      <div className="row" style={{ backgroud: `${bgcolor}` }}>
        <div className="col-md-12  d-flex  justify-content-center text-white  align-items-center">
          <button className="btn btn-basic" onClick={() => setDark()}>
            Light
          </button>
          <button className="btn btn-basic" onClick={() => setLight()}>
            Dark
          </button>
        </div>
      </div>
    );
  }
};
export default DarkLight;
